import React from 'react';
import './single-movie.styles.scss';

const SingleMovie = ({movies}) => (
    <>
    {movies.map(movie => (
      <div className="single-movie" key={movie.Title}>
          <section className="row">
              <div className="col"><img src={movie.Poster}></img></div>
              <div className="col right">
                  <h1>{movie.Title}</h1>

              </div>
          </section>


      </div>

    ))}
    </>

);

export default SingleMovie;
